import React from "react";
import useParams from 'react-router'
const Home =()=>{
    const students = [
        {id:1, name :"Harshita"},
        {id:2, name :"janaki"},
        {id:3, name :"Lalsa"},
        {id:4, name :"manikumar"},
        {id:5, name :"Karthik"},
    ]
    const {id} = useParams();


    return (
        <>
        <h1>Home</h1>
        <h4>hi how are you? {
            students.map((val)=>{
                return(
                    <>
                    <Link>{val.name}</Link>

                    </>
                )
            })
            }</h4>
        </>
    )
}

export default Home
